INSERT INTO `scms_news` (`news_id`, `cate_id`, `title`, `content`, `position`, `is_marked`, `upload`, `tags`, `hits`, `web_title`, `web_keywords`, `web_description`, `storage_number`, `order_price`, `link`, `related_news_id_list`, `lang`, `deleted`, `published`, `created_by`, `updated_at`, `updated_by`) VALUES
(1, 1, '示例项目', '<p>示例项目</p>', 1, 0, '', 'tag1,tag2', 0, '示例SEO标题', '示例SEO关键词', '示例SEO描述', 1, 0, NULL, '0', 'zh_cn', 0, 1, 1, 1252812201, 1),
(1, 1, 'Sample item', '<p>sample item description</p>', 1, 0, '', 'tag1,tag2', 0, 'Sample item SEO title', 'Sample item SEO keywords', 'Sample item SEO description', 1, 0, NULL, '0', 'en_us', 0, 1, 1, 1252812587, 1),
(2, 9, 'System Overview', 'The OneTrum REAL-TIME System is the world&#39;s first tubeless Semi-Closed Loop System, which includes tubeless insulin Pump, built-in Continuous Glucose Monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. The OneTrum REAL-Time System is small, compact, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend feature, which will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\n<br />', 68, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361951799, 1),
(3, 9, 'Tubeless Insulin Pump', 'The tubeless insulin pump combines key features of traditional insulin pumps like on-pump bolus buttons and detachability, with a small and slim size, thus providing flexibility, discreetness and freedom, all in one little patch.<br />\r\nTubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of insulin pump therapy.<br />\r\nWith just t two key parts that work together wirelessly-the micropump and the PDM, the tubeless insulin pump simplifies insulin pump therapy. The waterproof micropump integrates the pumping mechanism, cannula, needle, and insulin reservoir into one wearable unit. It is an all-in-one solution. No assembly required. Just add insulin and it&#39;s ready to go.', 66, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361708334, 1),
(4, 9, 'Built-in REAL-Time CGM', 'If you are using the built-in Continuous Glucose Monitoring (CGM) features, you can see your glucose levels 24 hours a day. The CGM provides the user with glucose measurements every two minute. This level of information, displayed in real-time on a wireless PDM, allows you to see a more detailed picture of&nbsp;your glucose levels, and give you a clear understanding of how your glucose is behaving and reduce your dependence on fingersticks. You only need to change your Glucose Sensor every 7 days.', 5, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361708759, 1),
(69, 14, 'What is Diabetes?', '<span style="font-size:24px;">What is Diabetes?</span><br />\r\n<br />\r\nDiabetes (medically known as diabetes mellitus) is the name given to disorders in which the body fails to produce or properly use insulin and has trouble regulating its blood glucose, or blood sugar, levels. A healthy pancreas releases precise amounts of rapid-acting insulin in response to the body&rsquo;s needs when sleeping or waking, eating or exercising, or just living. Insulin is necessary for the body to be able to use glucose for energy. When you eat food, the body breaks down all of the sugars and starches into glucose, which is the basic fuel for the cells in the body. Insulin takes the sugar from the blood into the cells. When glucose builds up in the blood instead of going into cells, it can lead to diabetes complications.', 72, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1361845155, 1),
(70, 14, 'Type 1 Diabetes', '<span style="color: #333">Type 1 diabetes is usually diagnosed in children and young adults, and was previously known as juvenile diabetes or insulin-dependent diabetes. In type 1 diabetes, the body does not produce insulin. Only5%&ndash;10% of people with diabetes have this form of the disease. Type 1 diabetes is currently incurable, but it is treatable with a rigid therapy of artificial insulin. With the help of insulin therapy and other treatments, even young children with type 1 diabetes can learn to manage their condition and live long, healthy, happy lives.</span>', 71, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361855523, 1),
(5, 9, 'Low Glucose Suspend', 'OneTrum REAL-Time System is equipped with a Low Glucose Suspend(LGS) feature, which will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia. Hypoglycemia can be one of the most frightening aspects of living with diabetes. And many people also find it extremely difficult to predict &ndash; and therefore almost impossible to avoid. It is very important that you are not delivering too much insulin to your body when your glucose levels are already low. The OneTrum REAL-Time System will automatically halt your insulin delivery when your glucose levels are too low. This new feature can really help you to put the fear of hypoglycemia and severe hypoglycemic excursions firmly behind you.', 4, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361708451, 1),
(6, 10, 'System Overview', 'The PatchTrum Nano pump is the world&rsquo;s first simple, programmable disposable pump for type 2 diabetes,with a small, slim, tubing-free size, thus providing flexibility, discreetness and freedom, all in one little patch.The Nano pump combines key features of traditional insulin pumps like on-pump basal-bolus buttons and audio alarms. The Nano pump is a fully disposable device and helps to cut the large upfront fee of traditional insulin pumps.<br />\r\n<br />', 26, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361708900, 1),
(19, 10, 'No up-front cost', 'The PatchTrum Nano is designed specifically for the treatment of diabetes type 2. It&rsquo;s disposable, so there&rsquo;s no up-front cost.With a traditional pump&rsquo;s retail price close to USD6000, this means that users could try PatchTrum Nano, and if they didn&rsquo;t like it, they wouldn&rsquo;t be out a mint.', 25, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360745676, 1),
(7, 10, 'Tubeless Insulin Pump', 'The OneTrum REAL-TIME System is the world&#39;s first tubeless Semi-Closed Loop System, which includes tubeless insulin Pump, built-in Continuous Glucose Monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend33 feature, which will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\nThe OneTrum REAL-TIME System is the world&#39;s first tubeless Semi-Closed Loop System, which includes tubeless insulin Pump, built-in Continuous Glucose Monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend33 feature, which will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\nThe OneTrum REAL-TIME System is the world&#39;s first tubeless Semi-Closed Loop System, which includes tubeless insulin Pump, built-in Continuous Glucose Monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend33 feature, which will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\nThe OneTrum REAL-TIME System is the world&#39;s first tubeless Semi-Closed Loop System, which includes tubeless insulin Pump, built-in Continuous Glucose Monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend33 feature, which will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.', 6, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 2, 1359955704, 2),
(8, 6, 'Customer Care', 'We are committed to providing our customers and healthcare professionals with high quality service and support every step of the way. Our customer support team and medical specialists are dedicated to &nbsp;assist our customers and healthcare professionals with the use of our products. We value feedback and believe in working together to achieve the best results.<br />\r\nIf you have any questions please e-mail <a href="mailto:info@medtrum.com">info@medtrum.com</a><br />\r\n<br />', 8, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1363073026, 1),
(9, 16, 'Overview', 'In insulin pump therapy, also known as Continuous Subcutaneous Insulin Infusion (CSII) Therapy, a system such as the PatchTrum delivers precise doses of rapid-acting insulin through a tiny, flexible catheter called a cannula. The insulin goes into the fatty tissue below subcutaneous tissue. You simply program your diabetes pump system to deliver it in two different ways:<br />\r\n<span style="font-size:14px;"><strong>Basal Rate:</strong> </span>Small amounts of insulin delivered continuously day and night to cover your body&rsquo;s normal insulin needs (not including food). The programmed rate is determined by your healthcare professional<br />\r\n<span style="font-size:14px;"><strong>Bolus Dose: </strong></span>Additional insulin you can deliver &ldquo;on demand&rdquo; to cover meals or snacks, or to help bring down high blood glucose. Insulin pumps have bolus calculators that help you calculate your bolus amount based on settings that are determined by your healthcare professional.<br />\r\nIf you talk to anyone using insulin pump therapy, most will tell you that a pump has changed their life for the better. Not only do they have improved blood glucose levels, but also more freedom and flexibility in their lifestyle. No wonder people on insulin pump therapy rarely look back. And, with the Medtrum&rsquo;s pump, you&rsquo;ll get all the benefits of insulin therapy in a way that no conventional insulin pump can deliver.', 11, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361848022, 1),
(10, 16, 'Benefits of Pump Therapy', '<span style="font-size: 14px"><strong>More Flexibility in lifestyle<br />\r\n</strong></span>Since the insulin pump uses only more predictable rapid-acting insulin, you will not need to follow a strict schedule for eating, activity, and insulin injections. You don&rsquo;t have to eat at the same time every day, or the same amount of food at each meal; You can eat when you are hungry, delay a meal if you want, even broaden your food choices; and you can extend insulin delivery for special meals, eating out, or banquets. You can also change your meal bolus based on the foods you choose to eat. If you do activities that lower your blood sugar such as riding your bike, playing with your kids, or gardening, Insulin pumps can be programmed to reduce your basal rate so that your blood sugar does not drop too low. If you are sick or have an infection and tend to have an increase in your blood sugar, insulin pumps can be programmed to increase your basal rate so that your blood sugar does not go up too high. A pump lets you make immediate adjustments to your insulin intake any time you want, so you can be spontaneous while still maintaining good blood glucose control.<br />\r\n<span style="font-size: 14px"><strong>Better control, Improved A1C, Fewer Complications</strong></span><br />\r\nInsulin pump therapy offers far better blood glucose control than injections, so you get off the high-low rollercoaster. Studies confirm an improvement in A1C when compared to MDI, as well as fewer blood glucose fluctuations. With proper insulin pump use, you can be four times more likely to achieve your target A1C and potentially reduce your low blood sugars by 84%. In addition, fewer severe hypoglycemic (low blood glucose) events have also been reported on insulin pump therapy. Since insulin pump therapy can help you achieve better control, you can reduce your long-term complications of diabetes such as eye, heart, kidney, and nerve damage. Keeping your blood glucose near normal can decrease diabetic eye disease by 76%, nerve disease by 60% and kidney disease by 56%.<br />\r\n<span style="font-size: 14px"><strong>Improved dosing,&nbsp;Better predictability</strong></span><br />\r\nTechnology has not only made pumps look more attractive and easy to use, but has also improved the precision and consistency of insulin dosing. This has allowed for delivery of very small but accurate insulin dosing.&nbsp;&nbsp;Insulin pumps use only rapid-acting insulin, which is absorbed with more predictability than multiple daily injections (MDI). Traditional, long-acting insulin can &ldquo;pool&rdquo; under the skin, resulting in uneven absorption rates causing unpredictable lows and highs. Insulin &ldquo;stacking&rdquo; is less of an issue when pumping insulin due to &ldquo;smart&rdquo; features that calculate insulin dose and remembers how much insulin is still active from previous bolus.&nbsp;<br />\r\n<span style="font-size: 14px"><strong>Fewer injections, Worry less, Live better</strong></span><br />\r\nWith multiple daily injections (MDI), you may take at least 120 injections per month. With insulin pump therapy, you can reduce this by 108 injections&mdash;you just change your infusion set 12 times per month. It&rsquo;s proven: people on pumps worry less about their insulin therapy. If you feel better, you will live better. Insulin pump users have greater improvements in quality of life, suggesting that insulin pumps were preferred over MDI.', 10, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361925568, 1),
(11, 16, 'Medtrum Insulin Pump Products', 'Medtrum offers a selection of products to make insulin management simple and easy. Learn more about which product is right for you.<br />\r\n<span style="font-size: 14px"><strong>MEDTRUM ONETRUM REAL-TIME SYSTEM&nbsp;FOR DIABETES TYPE 1<br />\r\n</strong></span>The OneTrum REAL-TIME System is the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend&nbsp;feature, which will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\n<span style="font-size: 14px"><strong>MEDTRUM PATCHTRUM NANO DISPOSALBE PUMPFOR DIABETES TYPE 2<br />\r\n</strong></span>The PatchTrum Nano pump is the world&rsquo;s first simple, programmable disposable pump for type 2 diabetes,with a small, slim, tube-free size, thus providing flexibility, discreetness and freedom, all in one little patch.The Nano pump combines key features of traditional insulin pumps like on-pump basal-bolus buttons andaudioalarms. The Nano pump is a fully disposable device and helps to cut the large upfront fee of traditional insulin pumps.<strong><br />\r\n<span style="font-size: 14px">MEDTRUM NETTRUM CARE ON MOBILE SYSTEM FORCHILDREN</span><br />\r\n</strong>The NetTrum Care on Mobile system is the world&rsquo;s first mobile telemetry system to provide real-time insulin delivery/Glucose monitoring for patients at home, at work or at school. Mobile connectivity ensures that real-time insulin delivery/Glucose monitoring information is available anytime and anywhere for patients, family and clinicians. The portal can be accessed by the internet in the clinic or through a smartphone, so alerts can be received and assessed for immediate response regardless of where, regardless of when.<strong><br />\r\n<span style="font-size: 14px">MEDTUM LINKTRUM DIABETES MANAGEMENT SOFTWARE</span><br />\r\n</strong>With LinkTrum Online, you can download your pump and CGM system at home or anywhere you have internet access. The online software turns the data into reports, providing you insights into patterns of your diabetes and therapy.', 9, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1361925708, 1),
(12, 25, 'OneTrum REAL-Time System', '<span style="font-size: 14px;color:#636363"><strong>Considerations - in choosing the OneTrum REAL-Time System for your patients<br />\r\n</strong></span>The OneTrum REAL-TIME System is the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function.<br />\r\n&bull; A full-featured insulin pump, with the personalized settings, programmable basals, Bolus calculator and safety features you have come to expect.<br />\r\n&bull; The built-in Continuous Glucose Monitoring(CGM) provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading.<br />\r\n&bull;The Low Glucose Suspend feature will automatically halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\n&bull; A No tubing Design, so there are a lot less potential tangles. Tubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of insulin pump therapy.<br />\r\n&bull;&nbsp;Minimal upfront cost: With minimal upfront cost, both payers and patients enjoy risk-free pricing terms, with no long-term commitment.<br />\r\n&bull; The OneTrum REAL-Time system is small, slim, lightweight and Wireless, making it easy for patients to wear it discreetly under any clothing and during most activities<br />\r\n&bull; Waterproof: We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your system when there&rsquo;s water around.', 15, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1362030420, 2),
(13, 25, 'PatchTrum Nano Disposable pump', '<span style="font-size: 14px;color:#636363"><strong>Considerations - in choosing the PatchTrum Nano Disposable pump for your patients</strong></span><br />\r\nThe PatchTrum Nano pump is the world&rsquo;s first simple, programmable disposable pump for type 2 diabetes, with a small, slim, tube-free size, thus providing flexibility, discreetness and freedom, all in one little patch.<br />\r\nNo up-front cost. No long-term commitment. The PatchTrum Nano is designed specifically for the treatment of diabetes type 2. It&rsquo;s disposable, so there&rsquo;s no up-front cost. With a traditional pump&rsquo;s retail price close to USD6000, this means that users could try PatchTrum Nano, and if they didn&rsquo;t like it, they wouldn&rsquo;t be out a mint.<br />\r\n&bull; Fully disposable: The Nano Disposable pump is a self-contained, sterile, patient fillable, single-use disposable insulin pump with an integrated subcutaneous cannula.<br />\r\n&bull; A No tubing Design, so there are a lot less potential tangles. The Nano pump doesn&rsquo;t have tubes, so there are a lot less potential tangles. Tubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of insulin pump therapy.<br />\r\n&bull; Advanced safety features. The PatchTrum Nano has advanced safety features like occlusion sensor and safety alerts<br />\r\n&bull; The PatchTrum Nano Disposable pum is small, slim, lightweight and Wireless, making it easy for patients to wear it discreetly under any clothing and during most activities.<br />\r\n&bull; Programmable basal and on-demand bolus. The Nano pump delivers insulin in a personalized way based on your personalized insulin program and on-demand bolus.<br />\r\n&bull; All-in-one patch: with the insulin reservoir, angled infusion set, automated inserter, needle, cannula, pumping mechanism, audio alarm and power supply built in, the Nano Pump is an all-in-one solution. No assembly required. Just add insulin and it&rsquo;s ready to go.<br />\r\n&bull; Waterproof: We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your pump when there&rsquo;s water around.', 14, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1362030427, 2),
(14, 25, 'RealTrum REAL-Time CGM', '<span style="font-size: 14px;color:#636363"><strong>Considerations - in choosing the RealTrum REAL-Time CGM for your patients<br />\r\n</strong></span>The RealTrum REAL-Time Continuous Glucose Monitoring (CGM) System provides the user with glucose measurements every two minute.<br />\r\n&bull; 7-day Flexible sensor: The FlexTrum 7-day Sensor is the smallest, thinnest, lightest and most discreet flexible sensor in the world, which combines excellent performance with features designed to provide exceptional comfort and ease of use. The Ultra-sensitive, round, and flexible sensor provides 7 day of use, and goes just under skin to read glucose levels, and attaches to the skin.<br />\r\n&bull; REAL-Time Remote Monitor: The REAL-Time Remote Monitor is a wireless device that displays glucose trends.<br />\r\n&bull; Transmitter for Professionals: The transmitter has a built-in professional mode to record up 7 days CGM data without a remote monitor at hand. Healthcare professionals are increasingly searching for tools to evaluate their patients&rsquo; glucose control in a quick and easy way to optimize their diabetes management. The transmitter in professional mode allows you to do just that.<br />\r\n&bull; The RealTrum REAL-Time CGM is small, slim, lightweight and Wireless, making it easy for patients to wear it discreetly under any clothing and during most activities.<br />\r\n&bull; Waterproof: We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your sensor when there&rsquo;s water around.', 13, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1362030434, 2),
(15, 25, 'NetTrum Diabetes Care on Mobile system for children', '<span style="font-size: 14px;color:#636363"><strong>Considerations - in choosing the NetTrum Care on Mobile system for children<br />\r\n</strong></span>The NetTrum Care on Mobile system is the world&rsquo;s first mobile telemetry system to provide real-time insulin delivery/Glucose monitoring for patients at home, at work or at school<br />\r\n&bull;Secure web data portal: A diabetes clinic with patients using the NetTrum system is able to see the current status of all its patients on a single screen. Not only is this status derived from comprehensive information captured and recorded by the handset, it is delivered to the clinic in real time.<br />\r\n&bull;Real-time insulin delivery/Glucose monitoring on mobile: Mobile connectivity ensures that real-time insulin delivery/Glucose monitoring information is available anytime and anywhere for patients, family and clinicians. The portal can be accessed by the internet in the clinic or through a smartphone, so alerts can be received and assessed for immediate response regardless of where, regardless of when.<br />\r\n&bull;Mobile Color Touch Screen handset: The color touch screen makes it easy-to-use interface accessible in a variety of light conditions. It&rsquo;s easy to read outdoors, or in a dark room, allowing you to easily and discreetly manage you insulin and glucose monitoring in any environment. The handset also features an integrated GPS to track and record outpatient&rsquo;s position. The handset runs a series of apps to help the user keep track of diet, insulin, blood glucose and exercise. By automating data collection, the handset eliminates the need for a diabetes journal and ensures that comprehensive and accurate clinical information are constantly available to all who need it.', 12, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 2, 1362030440, 2),
