(21, 10, 'No tubing', 'The Nano pump doesn&rsquo;t have tubes, so there are a lot less potential tangles.<br />\r\nTubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of insulin&nbsp;pump therapy.<br />', 23, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360745772, 1),
(22, 10, 'All-in-one patch', 'With the insulin reservoir, angled infusion set, automated inserter, needle, cannula, pumping mechanism, audio alarm and power supply built in, the Nano Pump is an all-in-one solution. No assembly required. Just add insulin and it&rsquo;s ready to go.', 22, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360745799, 1),
