(27, 11, 'System Overview', 'The RealTrum REAL-Time Continuous Glucose Monitoring (CGM) System, equipped with the world&rsquo;s smallest 7-day flexible sensor, provides the user with glucose measurements every two minute. This level of information, displayed in real-time on a wireless PDM, allows you to see a more detailed picture of&nbsp;your glucose levels, and give you a clear understanding of how your glucose is behaving and reduce your dependence on fingersticks. You only need to change your Glucose Sensor every 7 days.<br />\r\n<br />', 33, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361709367, 1),
(28, 11, 'FlexTrum 7-day Sensor', 'The FlexTrum 7-day Sensor is the smallest, thinnest, lightest and most discreet flexible sensor in the world, which combines excellent performance with features designed to provide exceptional comfort and ease of use. The Ultra-sensitive, round, and flexible sensor provides 7 day of use, and goes just under your skin to read glucose levels, and attaches to the skin.The transmitter snaps into the sensor to form a small and discreet patch that is wireless.The transmitter wirelessly sends glucose information to the Remote Monitor every 2 minutes.', 32, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360746599, 1),
(29, 11, 'REAL-Time Remote Monitor', 'The REAL-Time Remote Monitor is a wireless device that displays glucose trends.Not only will you always know what your glucose level is, you&#39;ll know which way it&#39;s heading, how fast it&#39;s moving there and, as you approach your glucose limits, you&#39;ll be warned to take action.You can clip the receiver to your belt, put it in your pocket or handbag. Everything you want to see about your glucose is at a glance.', 31, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361709524, 1),
(30, 11, 'Recorder for Professionals', 'The waterproof transmitter is a wireless device, with a small and sleek size thus giving discretion and comfort. The transmitter has a built-in Recorder for Professional mode to record up 7 days CGM data without a remote monitor at hand.Healthcare professionals are increasingly searching for tools to evaluate their patients&rsquo; glucose control in a quick and easy way to optimize their diabetes management. The transmitter in Recorder for Professionalmode allows you to do just that.', 30, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1360746640, 1),
(31, 11, 'Recorder for Professionals', 'The waterproof transmitter is a wireless device, with a small and sleek size thus giving discretion and comfort. The transmitter has a built-in Recorder for Professional Mode to record up 7 days CGM data without a remote monitor at hand. Healthcare professionals are increasingly searching for tools to evaluate their patients&rsquo; glucose control in a quick and easy way to optimize their diabetes management. The transmitter in Recorder for Professional Mode allows you to do just that.', 29, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361709448, 1),
(32, 11, 'Small & Slim', 'The RealTrum REAL-Time CGM system is small, slim, lightweight and wireless, making it easy for patients to wear it discreetly under any clothing and during most activities.<br />', 28, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361709544, 1),
(33, 11, 'IPX8 Waterproof', 'The RealTrum REAL-Time CGM systemis seriously waterproof, so you don&rsquo;t have to disconnect your system when there&rsquo;s water around.', 27, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360746688, 1),
(34, 12, 'System Overview', 'The NetTrum Care on Mobile system is the world&rsquo;s first mobile telemetry system to provide real-time insulin delivery/Glucose monitoring for patients at home, at work or at school. Mobile connectivity ensures that real-time insulin delivery/Glucose monitoring information is available anytime and anywhere for patients, family and clinicians. The NetTrum System combines popular mobile technologies with advanced medical systems to reduce the burden of diabetes management while also simplifying the achievement of diabetic control. In the next phase, the NetTrum Care on Mobile system will offer physicians a comprehensive portfolio of diabetes management, cardiac arrhythmia management and Blood Pressure Monitoring services for diagnosing patients and monitoring the efficacy of treatment. Medtrum&#39;s professional clinical technicians, patient educators, customer advocates, and operations personnel deliver leading-edge technology, accurate and efficient diagnostic reporting, and outstanding service.<br />\r\nThe NetTrum Care on Mobile system has three core parts:<br />\r\n&nbsp;', 37, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361709708, 1),
(35, 12, 'OneTrum REAL-Time system', 'The first is OneTrum REAL-Time system, the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend<sup> </sup>feature, which will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.', 36, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360751779, 1),
(36, 12, 'TouchTrum Color Touch-screen Handset', 'The second part is the TouchTrum app-based touch-screen handset, the brain of the NetTrum system. The color touch screen makes it easy-to-use interface accessible in a variety of light conditions. It&rsquo;s easy to read outdoors, or in a dark room, allowing you to easily and discreetly manage you insulin and glucose monitoring in any environment. The handsetalso features an integrated GPS to track and record outpatient&rsquo;s position. Wirelessly controlling the OneTrum REAL-Time system, the handset also has a mobile data connection to the Medtrum web-based Cloud portal. Mobile connectivity ensures that real-time information is available anytime and anywhere for patients, family and clinicians. The handset runs a series of apps to help the user keep track of diet, insulin, blood glucose and exercise. By automating data collection, the handset eliminates the need for a diabetes journal and ensures that comprehensive and accurate clinical information are constantly available to all who need it.', 35, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360747073, 1),
(37, 12, 'CloudTrum Secure Web Data Portal', 'The third part is the CloudTrum secure web-based data portal.With a mobile connection to a secure online Cloud portal, the NetTrum system ensures that patients, clinicians and parents are constantly aware of, and able to react to, changing conditions. A diabetes clinic with patients using the NetTrum system is able to see the current status of all its patients on a single screen. Not only is this status derived from comprehensive information captured and recorded by the handset, it is delivered to the clinic in real time. The portal can be accessed by the internet in the clinic or through a smartphone, so alerts can be received and assessed for immediate response regardless of where, regardless of when.', 34, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360747120, 1),
(61, 29, 'Product Overview', 'Medtrum&rsquo;s portfolio is headlined by the OneTrum REAL-Time system, which is a small &amp; slim and integrated diabetes management system consisting of a tubing-free insulin pump, contiguous glucose monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. Medtrum&rsquo;s development portfolio also includes the PatchTrum Disposable Insulin Pump for Diabetes Type 2, the RealTrum REAL-Time Continuous Glucose Monitoring (CGM) system and the NetTrum Diabetes Care on Mobile system. These products, when combined with the LinkTrum Diabetes Management Software, extend our lead on the path to developing an artificial pancreas&mdash;a &ldquo;closed-loop&rdquo; insulin delivery system.', 61, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1360753214, 1),
(38, 13, 'LinkTrum USB', 'Connect LinkTrum USB to your computer to send data from your Medtrum&rsquo;s diabetes products to LinkTrum Studio software or LinkTrum Online with no wires and cables.<br />', 40, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361242451, 2),
(39, 13, 'LinkTrum Online', 'LinkTrum Online is run via a website. With LinkTrum Online, you can download your pump and CGM system at home or anywhere you have internet access. The online software turns the data into reports, providing you insights into patterns of your diabetes and therapy.', 39, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360747440, 1),
(40, 13, 'LinkTrum Studio', 'With LinkTrum Studio, you can download the Pump and CGM data in minutes, access additional reports for insights. The software downloads the same data from the pump and CGM system to turn into reports that are slightly different and more clinically detailed compared to those in LinkTrum Online.', 38, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1360747468, 1),
(41, 17, 'Continuous Glucose Monitoring Overview', 'To successfully manage diabetes, a monitoring system is needed to consistently check your glucose levels. For many patients, monitoring glucose levels to manage their diabetes can be a challenge. The most common glucose monitoring solutions are traditional blood glucose meters (Fingersticks) and new technologies-continuous glucose monitoring (CGM) systems. Testing several times a day using traditional fingersticks tests may not provide sufficient information to be able to prevent potentially harmful levels of blood glucose.In fact, fingersticks can miss many of the potentially dangerous highs and lows that may occur throughout the day, which can impact your glucose control. CGM is a new way to measure glucose levels in real time throughout the day and night.CGM allows you to see a more detailed picture of their glucose levels, and give you a clear understanding of how your glucose is behaving and reduce your dependence on fingersticks. In addition, by providing this information in real time, you are given the opportunity to react to high or low glucose levels before they become dangerous.', 43, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361848117, 1),
(42, 17, 'Benefits of Continuous Glucose Monitoring', '<span style="font-size: 14px"><strong>Viewing of your glucose values continuously day and night</strong></span><br />\r\nOn screen glucose readings let you easily and discreetly view your current glucose values continuously day and night. It reveals changes in your glucose that often go unnoticed when only regular fingerstick measurements are used.<br />\r\n<span style="font-size: 14px"><strong>Informing the trend your glucose levels are going</strong></span><br />\r\nTrend arrows let you know if your glucose levels are rising or falling quickly, enabling you to take early action to reduce unnecessary lows and highs.<br />\r\n<span style="font-size: 14px"><strong>Predicting oncoming lows and highs</strong></span><br />\r\nPredictive Alerts can notify you before you reach your personal low or high glucose limits, andyou are given the opportunity to react to high or low glucose levels before they become dangerous.&nbsp;<br />\r\n<span style="font-size: 14px"><strong>Detecting lows or highs while you are sleeping</strong></span><br />\r\nLimit Alerts can inform you high and low glucose levels while you are sleeping, and help you to react sooner to high and low glucose levels.These alerts have shown an improvement of hypoglycemicin the middle of the night.<br />\r\n<span style="font-size: 14px"><strong>Easily getting Glucose Patterns</strong></span><br />\r\nTrend graphs allow you to view your past glucose levels to help you identify patterns and to know how food, physical activity, medication and illness impact on your diabetes.<br />\r\n<span style="font-size: 14px"><strong>Better control, Improved A1C, Fewer Complications</strong></span><br />\r\nCGM gives you greater control over the way you manage your diabetes.CGM has been proven to be an effective tool to reduce the frequency and duration of Highs and Lows.Studies confirm an improvement in A1C when compared to fingersticks. In addition, fewer severe hypoglycemic (low blood glucose) events have also been reported. Since CGM can help you achieve better control, you can reduce your long-term complications of diabetes such as eye, heart, kidney, and nerve damage.', 42, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361925801, 1),
(43, 17, 'Medtrum CGM Products', 'Medtrum offers a selection of products to make glucose monitoring simple and easy. Learn more about which product is right for you.<br />\r\n<span style="font-size: 14px"><strong>MEDTRUM ONETRUM REAL-TIME SYSTEM<br />\r\n</strong></span>The OneTrum REAL-TIME System is the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with a Low Glucose Suspend feature, which will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\n<span style="font-size: 14px"><strong>MEDTRUM REALTRUM REAL-TIME CGM SYSTEM<br />\r\n</strong></span>The RealTrum REAL-Time Continuous Glucose Monitoring (CGM) System provides the user with glucose measurements every two minute. This level of information, displayed in real-time on a wireless PDM, allows you to see a more detailed picture of their glucose levels, and give you a clear understanding of how your glucose is behaving and reduce your dependence on fingersticks. You only need to change your Glucose Sensor every 7 days.<br />\r\n<span style="font-size: 14px"><strong>MEDTRUM NETTRUM CARE ON MOBILE SYSTEM FORCHILDREN<br />\r\n</strong></span>The NetTrum Care on Mobile system is the world&rsquo;s first mobile telemetry system to provide real-time insulin delivery/Glucose monitoring for patients at home, at work or at school. Mobile connectivity ensures that real-time insulin delivery/Glucose monitoringinformation is available anytime and anywhere for patients, family and clinicians. The portal can be accessed by the internet in the clinic or through a smartphone, so alerts can be received and assessed for immediate response regardless of where, regardless of when.<br />\r\n<span style="font-size: 14px"><strong>MEDTUMLINKTRUM DIABETES MANAGEMENT SOFTWARE<br />\r\n</strong></span>With LinkTrum Online, you can download your pump and CGM system at home or anywhere you have internet access. The online software turns the data into reports, providing you insights into patterns of your diabetes and therapy.<br />\r\n&nbsp;<br />', 41, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361926021, 1),
(44, 4, 'Low Glucose Suspend(LGS)', '', 44, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1360748688, 1),
(45, 27, 'LGS Overview', 'Low Glucose Suspend(LGS) feature will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.', 47, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361846332, 1),
(46, 27, 'Benefits of LGS', 'Hypoglycemia can be one of the most frightening aspects of living with diabetes. And many people also find it extremely difficult to predict &ndash; and therefore almost impossible to avoid. It is very important that you are not delivering too much insulin to your body when your glucose levels are <em>already low</em>. The System with LGS feature will <em>automatically</em> halt your insulin delivery when your glucose levels are too low.This new feature can really help you to put the fear of hypoglycemia and severe hypoglycemic excursions firmly behind you.', 46, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361846342, 1),
(47, 27, 'Medtrum LGS Products', '<span style="font-size:14px;"><strong>MEDTRUM ONETRUM REAL-TIME SYSTEM&nbsp;</strong></span><br />\r\nThe OneTrum REAL-TIME System is the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function. The OneTrum REAL-Time System is small, slim, discreet, wireless and incredibly easy to use. The OneTrum REAL-Time System provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading. The OneTrum REAL-Time System is also equipped with Low Glucose Suspend&nbsp;feature, which will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.', 45, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361848219, 1),
(78, 19, 'Convenience and Discreteness', 'By pushing a couple of buttons, you can give your child insulin without the hassle of drawing up insulin with a syringe or getting out a pen and cleaning the skin. With insulin pumps becoming smaller and smaller in size, wearing a pump is very discreet. Your child can completely hide their insulin pump underneath their clothes.', 78, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1361846482, 1),
(48, 21, 'Benefits of Mobile Diabetes Telemetry System', 'Mobile Diabetes telemetry systemcan provide real-time insulin delivery/Glucose monitoring for patients at home, at work or at school The System combines popular mobile technologies with advanced medical systems to reduce the burden of diabetes management while also simplifying the achievement of diabetic control. In addition, the system will offer physicians a comprehensive portfolio of diabetes management, cardiac arrhythmia management and Blood Pressure Monitoring services for diagnosing patients and monitoring the efficacy of treatment.', 49, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361846757, 1),
(49, 21, 'Medtrum Diabetes Care on Mobile Products', '<span style="font-size:14px;"><strong>MEDTRUM NETTRUM CARE ON MOBILE SYSTEM FORCHILDREN</strong></span><br />\r\nThe NetTrum Care on Mobile system is the world&rsquo;s first mobile telemetry system to provide real-time insulin delivery/Glucose monitoring for patients at home, at work or at school. Mobile connectivity ensures that real-time insulin delivery/Glucose monitoringinformation is available anytime and anywhere for patients, family and clinicians. The portal can be accessed by the internet in the clinic or through a smartphone, so alerts can be received and assessed for immediate response regardless of where, regardless of when.', 48, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361848269, 1);
INSERT INTO `scms_news` (`news_id`, `cate_id`, `title`, `content`, `position`, `is_marked`, `upload`, `tags`, `hits`, `web_title`, `web_keywords`, `web_description`, `storage_number`, `order_price`, `link`, `related_news_id_list`, `lang`, `deleted`, `published`, `created_by`, `updated_at`, `updated_by`) VALUES
(50, 22, 'OneTrum REAL-Time System', 'The OneTrum REAL-TIME System is the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function.<br />\r\n&bull;<strong>Minimal upfront cost</strong>: With minimal upfront cost, both payers and patients enjoy risk-free pricing terms, with no long-term commitment.<br />\r\n&bull; A <strong>full-featured insulin pump</strong>, with the personalized settings, programmable basals, Bolus calculator and safety features you have come to expect.<br />\r\n&bull; The <strong>built-in Continuous Glucose Monitoring(CGM) </strong>provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading.<br />\r\n&bull;The <strong>Low Glucose Suspend </strong>feature will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\n&bull; A <strong>No tubing Design</strong>, so there are a lot less potential tangles. Tubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of <strong>insulin</strong>&nbsp;pump therapy.<br />\r\n&bull; The <strong>OneTrum REAL-Time system is small, slim, lightweight and Wireless</strong>, making it easy for patients to wear it discreetly under any clothing and during most activities<br />\r\n&bull;<strong>Waterproof:</strong>We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your system when there&rsquo;s water around.', 51, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361846975, 1),
(51, 22, 'RealTrum REAL-Time CGM', 'The RealTrum REAL-Time Continuous Glucose Monitoring (CGM) System provides the user with glucose measurements every two minute.<br />\r\n&bull;<span style="font-size: 12px"><strong>7-day Flexible sensor:</strong></span>The FlexTrum 7-day Sensor is the smallest, thinnest, lightest and most discreet flexible sensor in the world, which combines excellent performance with features designed to provide exceptional comfort and ease of use. The Ultra-sensitive, round, and flexible sensor provides 7 day of use, and goes just under skin to read glucose levels, and attaches to the skin.<br />\r\n&bull; <span style="font-size: 12px"><strong>REAL-Time Remote Monitor:</strong></span>The REAL-Time Remote Monitor is a wireless device that displays glucose trends.<br />\r\n&bull; <span style="font-size: 12px"><strong>Recorder for Professionals:</strong></span>The transmitter has a built-in professional mode to record up 7 days CGM data without a remote monitor at hand.Healthcare professionals are increasingly searching for tools to evaluate their patients&rsquo; glucose control in a quick and easy way to optimize their diabetes management. The transmitter in professional mode allows you to do just that.<br />\r\n&bull; <span style="font-size: 12px"><strong>The</strong> <strong>RealTrum REAL-Time CGM is small, slim, lightweight and Wireless: </strong></span>making it easy for patients to wear it discreetly under any clothing and during most activities.<br />\r\n&bull;<span style="font-size: 12px"><strong>Waterproof:</strong></span>We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your sensor when there&rsquo;s water around.', 50, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361926549, 1),
(52, 23, 'PatchTrum Nano Disposable pump', 'The PatchTrum Nano pump is the world&rsquo;s first simple, programmable disposable pump for type 2 diabetes,with a small, slim, tube-free size, thus providing flexibility, discreetness and freedom, all in one little patch.<br />\r\n<strong>No up-front cost, Pay as you go. </strong>The PatchTrum Nano is designed specifically for the treatment of diabetes type 2. It&rsquo;s disposable, so there&rsquo;s no up-front cost.With a traditional pump&rsquo;s retail price close to USD6000, this means that users could try PatchTrum Nano, and if they didn&rsquo;t like it, they wouldn&rsquo;t be out a mint.<br />\r\n&bull; <strong>Fully disposable:</strong>The Nano Disposable pumpis a self-contained, sterile, patient fillable, single-use disposable insulin pump with an integrated subcutaneous cannula.<br />\r\n&bull; A <strong>No tubing Design</strong>, so there are a lot less potential tangles. The Nano pump doesn&rsquo;t have tubes, so there are a lot less potential tangles. Tubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of <strong>insulin </strong>pump therapy.<br />\r\n&bull; <strong>Advanced safety features. </strong>The PatchTrum Nano has advanced safety features like occlusion sensor and safety alerts<br />\r\n&bull; The <strong>PatchTrum Nano Disposable pum</strong><strong>is small, slim, lightweight and Wireless</strong>, making it easy for patients to wear it discreetly under any clothing and during most activities.<br />\r\n&bull;<strong>Programmable basal and on-demand bolus. </strong>The Nano pump delivers insulin in a personalized way based on your personalized insulin programand on-demand bolus.<br />\r\n&bull; <strong>All-in-one patch:</strong>with the insulin reservoir, angled infusion set, automated inserter, needle, cannula, pumping mechanism, audio alarm and power supply built in, the Nano Pump is an all-in-one solution. No assembly required. Just add insulin and it&rsquo;s ready to go.<br />\r\n&bull;<strong>Waterproof:</strong>We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your pump when there&rsquo;s water around.<br />', 54, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361847003, 1),
(53, 23, 'RealTrum REAL-Time CGM', 'The RealTrum REAL-Time Continuous Glucose Monitoring (CGM) System provides the user with glucose measurements every two minute.<br />\r\n&bull;<strong>7-day Flexible sensor</strong>:The FlexTrum 7-day Sensor is the smallest, thinnest, lightest and most discreet flexible sensor in the world, which combines excellent performance with features designed to provide exceptional comfort and ease of use. The Ultra-sensitive, round, and flexible sensor provides 7 day of use, and goes just under skin to read glucose levels, and attaches to the skin.<br />\r\n&bull; <strong>REAL-Time Remote Monitor:</strong>The REAL-Time Remote Monitor is a wireless device that displays glucose trends.<br />\r\n&bull; <strong>Transmitter for Professionals:</strong>The transmitter has a built-in professional mode to record up 7 days CGM data without a remote monitor at hand.Healthcare professionals are increasingly searching for tools to evaluate their patients&rsquo; glucose control in a quick and easy way to optimize their diabetes management. The transmitter in professional mode allows you to do just that.<br />\r\n&bull; The <strong>RealTrum REAL-Time CGM is small, slim, lightweight and Wireless</strong>, making it easy for patients to wear it discreetly under any clothing and during most activities.<br />\r\n&bull;<strong>Waterproof:</strong>We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your sensor when there&rsquo;s water around.', 53, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361847013, 1),
