(60, 28, 'OneTrum REAL-Time System', 'The OneTrum REAL-TIME System is the world&rsquo;s first tubeless insulin pump with built-in CGM and Low Glucose Suspend(LGS) function.<br />\r\n&bull;<strong>Minimal upfront cost</strong>: With minimal upfront cost, both payers and patients enjoy risk-free pricing terms, with no long-term commitment.<br />\r\n&bull; A <strong>full-featured insulin pump</strong>, with the personalized settings, programmable basals, Bolus calculator and safety features you have come to expect.<br />\r\n&bull; The <strong>built-in Continuous Glucose Monitoring(CGM) </strong>provides glucose readings every two minutes so you always know where your glucose levels are and where they are heading.<br />\r\n&bull;The <strong>Low Glucose Suspend </strong>feature will <em>automatically</em> halt your insulin delivery when your glucose levels are too low to help to reduce the risk of severe hypoglycemia.<br />\r\n&bull; A <strong>No tubing Design</strong>, so there are a lot less potential tangles. Tubing of traditional pumps can get twisted, pulled out by accident, kinked or filled with air bubbles. In many ways, it can feel like a leash. The study has demonstrated the benefits of a tubing-free insulin pump, which can help patients overcome their fear of insertion sets or unsightly tubing and achieve the clinical benefits of <strong>insulin</strong>&nbsp;pump therapy.<br />\r\n&bull; The <strong>OneTrum REAL-Time system is small, slim, lightweight and Wireless</strong>, making it easy for patients to wear it discreetly under any clothing and during most activities<br />\r\n&bull;<strong>Waterproof:</strong>We&rsquo;re seriously waterproof, so you don&rsquo;t have to disconnect your system when there&rsquo;s water around.', 58, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361847087, 1),
(62, 30, 'Semi-Closed Loop System', 'The world&rsquo;s first Tubeless Semi-<br />\r\nClosed Loop System integrates tubeless pump and built-in CGM with Low Glucose Suspend to help avoid hypoglycemia.', 65, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, 'products.php?cate_id=9', NULL, 'zh_cn', 0, 1, 2, 1361934438, 2),
(63, 30, 'Disposable Insulin Pump', 'The world&rsquo;s first disposable pump with advanced safety features is developed specifically for diabetes type 2. There&rsquo;s no upfront cost, just pay as you go.', 64, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, 'products.php?cate_id=10', NULL, 'zh_cn', 0, 1, 2, 1361934402, 2),
(64, 30, 'REAL-Time CGM System', 'The world&rsquo;s smallest 7-day flexible sensor, snapped with a small &amp; slim transmitter, provides every-<br />\r\nthing you want to see about glucose at a glance.', 63, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, 'products.php?cate_id=11', NULL, 'zh_cn', 0, 1, 2, 1361934486, 2),
(65, 30, 'Diabetes Care on Mobile', 'The first mobile Diabetes system ensures that insulin delivery information and glucose reading is available anytime and anywhere for patients and family.', 62, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, 'products.php?cate_id=12', NULL, 'zh_cn', 0, 1, 2, 1361437404, 2),
(66, 9, 'Minimal Upfront Cost', 'With minimal upfront cost, both payers and patients can enjoy risk-free pricing terms, with no long-term commitment.<br />', 67, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361428362, 1),
(67, 9, 'Small & Slim', 'The OneTrum REAL-Time System is small, compact, lightweight and wireless, making it easy for patients to wear it discreetly under any clothing and during most activities.', 3, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361428592, 1),
(68, 9, 'IPX8 Waterproof', 'The OneTrum REAL-Time System is seriously waterproof, so you don&rsquo;t have to disconnect your pump when there&rsquo;s water around.<br />', 2, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361428632, 1),
(71, 14, 'Type 2 Diabetes', '<span style="color: #333">Type 2 diabetes results when the body does not produce enough insulin or the cells ignore the insulin. Type 2 diabetes is the most common form of diabetes. Type 2 diabetes represents 90%&ndash;95% of all diagnosed cases. Some groups have a higher risk for developing type 2 diabetes than others, but type 2 diabetes can also be caused by poor diet and an inactive lifestyle. If caught in its early stages, type 2 diabetes is often treatable with modifications in diet and an exercise program. If left untreated, a person with type 2 diabetes could eventually develop and require the addition of artificial insulin.</span>', 70, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361855502, 1),
(72, 14, 'Gestational Diabetes', '<span style="color: #333">During pregnancy &ndash; usually around the 24th week &ndash; many women , who have high blood glucose levels, develop gestational diabetes. A diagnosis of gestational diabetes doesn&#39;t mean that you had diabetes before you conceived, or that you will have diabetes after giving birth. The condition usually goes away after pregnancy, but if left untreated can harm the baby.</span>', 69, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1361855514, 1),
(73, 15, 'New Therapy---Semi-Closed Loop System', 'The Semi-Closed Loop System, an integrated insulin pump and continuous glucose monitor with Low Glucose Suspend feature (LGS), can stop insulin delivery when glucose becomes dangerous low, which could be of great benefit to avoid severe hypoglycemia if a person with diabetes is asleep or unable to react. Study has showed a reduction in time spent below the low glucose threshold in people with diabetes using the Low Glucose Suspend feature (LGS), compared to conventional pump therapy. Reducing the amount of time spent below the low glucose threshold without rebound hyperglycemia (high blood sugar) could help people with diabetes stay in better glucose control.', 73, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1362030158, 2),
(74, 15, 'Continuous Glucose Monitoring (CGM)', 'Continuous Glucose Monitoring (CGM) provide valuable glucose trend information, making it easier to know how food, insulin, and activity are affecting your glucose readings&mdash;all day and all night&mdash;by displaying the information on the device screen. It can alert you to dangerous high or low glucose levels, allowing you to take action and potentially prevent complications.', 74, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1362030143, 2),
(79, 19, 'Fewer injections, Worry less, Live better', 'With multiple daily injections (MDI), your child may take at least 1,460per month. With insulin pump therapy, it is recommended that you change the infusion set on the skin where the insulin pump is continuously delivering insulin every 2&ndash;3 days. As a result, instead of thousands of injections a year, your child receives approximately 120. If your child feel better, your child will live better. Compared to children on injections, families with insulin pump users reported higher levels of satisfaction and fewer worries about their child&#39;s diabetes.We&#39;re dedicated to creating life-saving products to help you and your child best manage diabetes.', 79, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1361846497, 1),
(75, 15, 'Insulin Pump Therapy', 'Pump therapy is a real alternative to conventional injection therapy. With the right pump therapy, you have tight insulin management, minimizing the risk of highs and lows in your day-to-day life&mdash;and of complications in the future. Moreover, you can eat, sleep and exercise just the way you want.', 75, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1362030124, 2),
(76, 15, 'Insulin Treatment and Hypoglycemia', 'Hypoglycemia can be one of the most frightening aspects of living with diabetes because it can result in confusion, unresponsiveness, loss of consciousness, coma and &ndash; in rare cases &ndash; even death. Research has indicated that, on average, a person with diabetes will experience more than one low blood glucose event every two weeks. Each year nearly one in 14 people with insulin-treated diabetes will experience one or more episodes of severe hypoglycemia.<br />\r\n<br />', 76, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 0, 1, 1, 1362030107, 2),
(77, 15, 'Managing Diabetes', '<span style="color:#139ce7;"><span style="font-size: 24px;">Managing Diabetes</span></span><br />\r\n<br />\r\nLiving with diabetes is certainly not as carefree as living without it. But managing diabetes doesn&rsquo;t need to be all-consuming. Therapy options, your diet, your activites and how you manage glucose lows, glucose highs, and sick days will have a significant impact on your overall health.', 77, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1361845743, 1),
(80, 19, 'Improved dosing, Better predictability', 'Compared to MDI using syringes or pens, Insulin pumps allow you to deliver smaller and more precise doses of insulin when that&rsquo;s all your child&rsquo;s body needs. Insulin pumps only use rapid-acting insulin, which is absorbed by the body in a more predictable way.', 80, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1361846512, 1),
(81, 19, 'Benefits of pump therapy for children', '<span style="font-size: 14px"><strong>More Flexibility in lifestyle<br />\r\n</strong></span>With an insulin pump, you and your child will be able to better respond to changing schedules and unpredictable eating habits. If your child decides to go play outside, simply check blood sugar levels, appropriately adjust the rate of insulin delivery with a couple of button pushes, and off you go.', 81, 0, '', NULL, 0, NULL, NULL, NULL, 0, 0, NULL, NULL, 'zh_cn', 1, 1, 1, 1361926221, 1);
