(1, 0, '示例分类', '示例分类描述', '', 1, 'seo', '', '示例分类SEO标题', '示例分类SEO关键词', '示例分类SEO关键词', 'zh_cn', 0, 1, 1253293270, 1),
(2, 0, 'Home', '<br />', '#13030718223114549811.png', 2, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362651755, 1),
(3, 0, 'Products', '<br />', '#13022117001739589211.jpg', 3, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1361437219, 2),
(4, 0, 'Treatment Options', '<br />', '#13022117003876543511.jpg', 4, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1361437240, 2),
(5, 0, 'Healthcare Professionals', '<br />', '13030117403658348511.jpg', 5, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362130836, 2),
(6, 0, 'Support', '<br />', '13020415404352224911.jpg', 6, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1359963647, 2),
(7, 0, 'Community', '<br />', '13022514340239772111.jpg', 7, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1361774047, 2),
(8, 0, 'About Medtrum', 'Medtrum is committed to developing and commercializing innovative solutions to improve the lives of people with diabetes.&nbsp;We believe that new technologies can simplify diabetes management . Our dedication has led to the development of revolutionary products which include:<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; <strong>The first Tubing-free Semi-Closed Loop system for Diabetes Type 1<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; The first Programmable &amp; Disposable Insulin Pump for Diabetes Type 2<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; The smallest 7-day flexible sensor and Continuous Glucose Monitoring system<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; The first Diabetes Care on Mobile telemetry system for Children<br />\r\n</strong>Medtrum&rsquo;s portfolio is headlined by the OneTrum REAL-Time system, which is a an integrated diabetes management system composed of a tubing-free insulin pump, contiguous glucose monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. Medtrum&rsquo;s development portfolio also includes the PatchTrum Disposable Insulin Pump for Diabetes Type 2, the RealTrum REAL-Time Continuous Glucose Monitoring (CGM) system and the NetTrum Diabetes Care on Mobile system. These products, when combined with the LinkTrum Diabetes Management Software, extend our lead on the path to developing an artificial pancreas&mdash;a &ldquo;closed-loop&rdquo; insulin delivery system.<br />\r\n&nbsp;<br />\r\n<strong>For more information about MedTrum email</strong><a href="mailto:info@medtrum.com">info@medtrum.com</a>', '13020415412866287411.jpg', 8, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1361429373, 1),
(9, 3, 'OneTrum Real-Time System', '<br />', '#13030718230680333711.png', 10, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362651790, 1),
(10, 3, 'PatchTrum Nano Disposable pump', '<br />', '#13030718240163372711.png', 11, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362651844, 1),
(11, 3, 'RealTrum Pro Real-Time CGM', '<br />', '13031118284716037411.png', 12, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362997732, 2),
(12, 3, 'NetTrum Diabetes on Mobile', '<br />', '#13030718243731390911.png', 13, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362651879, 1),
(13, 3, 'Diabetes Management Software', '<br />', '13030618230463675411.png', 29, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362565389, 2),
(14, 4, 'What is Diabetes?', '<span style="color: #333">Diabetes (medically known as diabetes mellitus) is the name given to disorders in which the body fails to produce or properly use insulin and has trouble regulating its blood glucose, or blood sugar, levels. A healthy pancreas releases precise amounts of rapid-acting insulin in response to the body&rsquo;s needs when sleeping or waking, eating or exercising, or just living. Insulin is necessary for the body to be able to use glucose for energy. When you eat food, the body breaks down all of the sugars and starches into glucose, which is the basic fuel for the cells in the body. Insulin takes the sugar from the blood into the cells. When glucose builds up in the blood instead of going into cells, it can&nbsp;lead to&nbsp;diabetes complications.</span><br />', '', 14, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029657, 1),
(15, 4, 'Managing Diabetes', 'Living with diabetes is certainly not as carefree as living without it. But managing diabetes doesn&rsquo;t need to be all-consuming. Therapy options, your diet, your activites and how you manage glucose lows, glucose highs, and sick days will have a significant impact on your overall health.', '', 15, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362030185, 2),
(16, 4, 'Insulin Pump Therapy', '', '', 16, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029686, 1),
(17, 4, 'Continuous Glucose Monitoring', '', '', 17, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029696, 1),
(18, 4, 'Diabetes Management Software', '<br />', '', 18, '', NULL, NULL, NULL, NULL, 'zh_cn', 1, 2, 1359961014, 2),
(19, 4, 'Children and Pump Therapy', '<strong><span style="font-size: 16px">Benefits of pump therapy for children<br />\r\n</span>More Flexibility in lifestyle</strong><br />\r\nWith an insulin pump, you and your child will be able to better respond to changing schedules and unpredictable eating habits. If your child decides to go play outside, simply check blood sugar levels, appropriately adjust the rate of insulin delivery with a couple of button pushes, and off you go.<br />\r\n<strong>Improved dosing,&nbsp;</strong><strong>Better predictability</strong><br />\r\nCompared to MDI using syringes or pens, Insulin pumps allow you to deliver smaller and more precise doses of insulin when that&rsquo;s all your child&rsquo;s body needs. Insulin pumps only use rapid-acting insulin, which is absorbed by the body in a more predictable way.<br />\r\n<strong>Fewer injections, Worry less, Live better </strong><br />\r\nWith multiple daily injections (MDI), your child may take at least 1,460per month. With insulin pump therapy, it is recommended that you change the infusion set on the skin where the insulin pump is continuously delivering insulin every 2&ndash;3 days. As a result, instead of thousands of injections a year, your child receives approximately 120. If your child feel better, your child will live better. Compared to children on injections, families with insulin pump users reported higher levels of satisfaction and fewer worries about their child&#39;s diabetes.We&#39;re dedicated to creating life-saving products to help you and your child best manage diabetes.<br />\r\n<strong>Convenience and Discreteness</strong><br />\r\nBy pushing a couple of buttons, you can give your child insulin without the hassle of drawing up insulin with a syringe or getting out a pen and cleaning the skin. With insulin pumps becoming smaller and smaller in size, wearing a pump is very discreet. Your child can completely hide their insulin pump underneath their clothes.<br />\r\n<br />\r\n<br />', '', 20, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029721, 1),
(20, 4, 'Pregnancy and Pump Therapy', '<strong><span style="font-size: 18px">Benefits of pump therapy for pregnancy<br />\r\n</span></strong>&bull; Mimic normal physiology using variable basal rates allowing for easier achievement of tight glucose control required to maintain a healthy pregnancy<br />\r\n&bull; Decrease extreme glucose excursions<br />\r\n&bull; Reduce the risk of severe hypoglycemia<br />\r\n&bull; Improve management of morning sickness by eliminating need to eat on rising<br />\r\n&bull; Reduce after-meal hyperglycemia due to delayed gastric emptying during pregnancy using bolus options that extend insulin delivery over&nbsp;time', '', 21, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029744, 1),
(21, 4, 'Mobile Diabetes Telemetry', '', '', 22, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029754, 1),
(22, 4, 'Products for Type 1 Diabetes', '', '', 23, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029764, 1),
(23, 4, 'Products for Type 2 Diabetes', '', '', 24, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029774, 1),
(24, 4, 'Products for Children', '', '', 27, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029785, 1),
(25, 5, 'Therapy Considerations', '', '', 25, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029806, 1),
(26, 5, 'Clinical Study', 'We are with you every step of the way. We&rsquo;re thinking about what might simplify you day-to-day life. Our years research and thousands of in-depth conversation with people with and diabetes and health care professionals didn&rsquo;t just result in the world&rsquo;s first tubing-free insulin pump with Continuous Glucose Monitoring for diabetes type 1. We also provide world&rsquo;s first disposable insulin pump for diabetes type 2. Our customer support team and clinical diabetes specialists are here to support people using and working with our products.<br />\r\nIf you have any questions please e-mail info@medtrum.com', '', 26, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1362029818, 1),
(27, 4, 'Low Glucose Suspend(LGS)', '', '', 19, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 1, 1362029708, 1),
(28, 4, 'Products for Pregnancy', '', '', 28, '', NULL, NULL, NULL, NULL, 'zh_cn', 0, 1, 1362029794, 1),
(29, 3, 'Products Overview', 'Medtrum&rsquo;s portfolio is headlined by the OneTrum REAL-Time system, which is a small &amp; slim and integrated diabetes management system consisting of a tubing-free insulin pump, contiguous glucose monitoring (CGM) and Low Glucose Suspend (LGS) mechanism. Medtrum&rsquo;s development portfolio also includes the PatchTrum Disposable Insulin Pump for Diabetes Type 2, the RealTrum REAL-Time Continuous Glucose Monitoring (CGM) system and the NetTrum Diabetes Care on Mobile system. These products, when combined with the LinkTrum Diabetes Management Software, extend our lead on the path to developing an artificial pancreas&mdash;a &ldquo;closed-loop&rdquo; insulin delivery system.', '', 9, '', NULL, NULL, NULL, NULL, 'zh_cn', 1, 1, 1360753063, 1),
(30, 2, 'Four part', '<br />', '', 30, 'link', NULL, NULL, NULL, NULL, 'zh_cn', 0, 2, 1361437378, 2);
